import './App.css';
import React, { Component } from 'react';

class App extends Component {
    constructor(props) {

        super(props);

        this.state = {
            list: list
        };
    }
}

const list = [{
    title: 'React',
    url: 'https://facebook.com/',
    author: 'Jordan drake',
    num_comments: 3,
    points: 4,
    objectID: 0
},
{
    title: 'React-DOM',
    url: 'https://gitHub.com/',
    author: 'Michael jordan',
    num_comments: 5,
    points: 7,
    objectID: 1
}
]


function render() {
    return (
        <div className="App" > {
            list.map(item =>
                <div key={item.objectID}>
                    <span>
                        <a href={item.title}> {item.title}</a>
                    </span>
                    <span>{item.author}</span>
                    <span>{item.num_comments}</span>
                    <span>{item.points}</span>
                </div>

            )
        }
        </div>
    );
}

export default App;
